import React from 'react'
import imgOne from './img/cardOneOften.webp'
import imgTwo from './img/cardTwoOften.webp'
import imgThree from './img/cardThreeOften.webp'
import imgFour from './img/cardFourOften.webp'
import OftenOrder from './oftenOrder'

function MiniListCard() {
  
  const List = [
    {
      id: 1,
      img: imgOne,
      name: 'Пеперони',
      price: 'От 445 сом'
    },
    {
      id: 2,
      img: imgTwo,
      name: 'Мексиканская',
      price: 'От 445 сом'
    },
    {
      id: 3,
      img: imgThree,
      name: 'Пеперони',
      price: 'От 445 сом'
    },
    {
      id: 4,
      img: imgFour,
      name: 'Пеперони',
      price: 'От 445 сом'
    }
  ]
 
  return (
    <div>
      <OftenOrder List={List} />
    </div>
  )
}

export default MiniListCard
